import React from "react";
import perfilCircular from "../Img/perfilCircular.png";
import "./Contact.css";
const Contact = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col-12">
          <p className="text-contact fs-1">Contact</p>
        </div>
      </div>
      <div className="row container-contact ">
        <div className="col-4 ">
          <img
            src={perfilCircular}
            alt="..."
            className="img-fluid h-img-perfil pt-4 pb-4"
          />

          <p className="d-flex justify-content-center align-content-center  m-0 fs-3 h-text ">
            Ricardo Ramirez
          </p>
          <p className=" h-text2 ">Desarrollador Web</p>
        </div>
        <div className="col bg-danger">
          <p className="fs-1 h-text2 pt-4">Llamame o dejame un whp</p>
          <i class="bi bi-whatsapp mx-2"></i>
          <i class="bi bi-telephone-fill">
            <br />
            1132716458
          </i>
        </div>
      </div>
    </div>
  );
};

export default Contact;
